        join:
          joinCondition: |-
            FROM s_nexus_visit_20
              LEFT OUTER JOIN s_nexus_visit_20 s_nexus_visit_prev
                ON s_nexus_visit_20.theatre_session_reference_no = s_nexus_visit_prev.theatre_session_reference_no
               AND s_nexus_visit_20.session_theatre_visit_Seq_num - 1 = s_nexus_visit_prev.session_theatre_visit_Seq_num
              LEFT OUTER JOIN s_nexus_visit_20 s_nexus_visit_next
                ON s_nexus_visit_20.theatre_session_reference_no = s_nexus_visit_next.theatre_session_reference_no
               AND s_nexus_visit_20.session_theatre_visit_Seq_num + 1 = s_nexus_visit_next.session_theatre_visit_Seq_num
              LEFT OUTER JOIN s_nexus_visit_20 s_nexus_visit_first
                ON s_nexus_visit_20.theatre_session_reference_no = s_nexus_visit_first.theatre_session_reference_no
               AND s_nexus_visit_first.session_theatre_visit_Seq_num = 1
              LEFT OUTER JOIN s_nexus_visit_20 s_nexus_visit_last
                ON s_nexus_visit_20.theatre_session_reference_no = s_nexus_visit_last.theatre_session_reference_no
               AND s_nexus_visit_last.session_theatre_visit_Seq_num = s_nexus_visit_last.session_theatre_visit_count
              LEFT OUTER JOIN {{ ref('TGT','S_NEXUS_OPPROC_SUMMARY') }}
                ON s_nexus_visit_20.opnumber = s_nexus_OPPROC_summary.opnumber
              LEFT OUTER JOIN {{ ref('TGT','DIM_SUPPORT_ANAESTHETIST') }}
                ON s_nexus_visit_20.support_anaesthetist = dim_support_anaesthetist.support_anaesthetist_code
              LEFT OUTER JOIN {{ ref('TGT','DIM_TECHNICIAN_ANAESTHETIST') }}
                ON s_nexus_visit_20.technician_anaesthetist = dim_technician_anaesthetist.technician_anaesthetist_code
              LEFT OUTER JOIN {{ ref('TGT','DIM_OPERATION_TYPE') }}
                ON s_nexus_visit_20.op_type = dim_operation_type.Operation_type_Code
               AND dim_operation_type.source_system = 'NX'
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp1
                ON s_nexus_visit_20.primary_Procedure = dtp1.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp1.dss_start_date AND dtp1.dss_end_date
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp2
                ON s_nexus_visit_20.secondary_Procedure = dtp2.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp2.dss_start_date AND dtp2.dss_end_date
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp3
                ON s_nexus_visit_20.third_Procedure = dtp3.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp3.dss_start_date AND dtp3.dss_end_date
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp4
                ON s_nexus_visit_20.fourth_Procedure = dtp4.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp4.dss_start_date AND dtp4.dss_end_date
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp5
                ON s_nexus_visit_20.fifth_Procedure = dtp5.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp5.dss_start_date AND dtp5.dss_end_date
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp6
                ON s_nexus_visit_20.sixth_Procedure = dtp6.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp6.dss_start_date AND dtp6.dss_end_date
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp7
                ON s_nexus_visit_20.seventh_Procedure = dtp7.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp7.dss_start_date AND dtp7.dss_end_date
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp8
                ON s_nexus_visit_20.eighth_Procedure = dtp8.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp8.dss_start_date AND dtp8.dss_end_date
              LEFT OUTER JOIN {{ ref('TGT','DIM_THEATRE_PROCEDURE') }} dtp9
                ON s_nexus_visit_20.ninth_Procedure = dtp9.theatre_procedure_Code
               AND s_nexus_visit_20.opdate BETWEEN dtp9.dss_start_date AND dtp9.dss_end_date
